import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

function formatName(user) {
  return user.fname + ' ' + user.lname;
}

const user = {
  fname: "Bishal",
  lname: "Magar"
};

const element = <h1>Hello, {formatName(user)}</h1>

ReactDOM.render(
  element
);

export default App;
